import React from 'react'
import { styled } from '@mui/material/styles';
import {Grid,Box} from '@mui/material';
import Nav from './Nav';
import Dashboard from './Dashboard'

const Home = () => {
  const DashboardGrid = styled(Grid)({
    backgroundColor: `gold`,
    borderRadius: `10`
  });
  return (
    <div>
      <Box>
        <Grid container>
          <Grid xs={3}>
            <Nav/>
          </Grid>
          <DashboardGrid xs={9}>
            <Dashboard/>
          </DashboardGrid>
        </Grid>
      </Box>
    </div>
  )
}

export default Home
